import { Navbar } from './util/Navbar';
import "./App.css"
import { StudentPage } from './pages/StudentPage';
import { Footer } from './components/Footer';

import { createBrowserRouter } from 'react-router-dom';

createBrowserRouter([
  { path: ""},
  {}
])

function App() {
  return (
    <div style={{ minHeight:"100vh" }} className="App">
      <Navbar/>
      <StudentPage/>
     <Footer/>
    </div>
  );
}

export default App;
